import Router from './Router';
import {HeaderWrapper,ImgHolder,HeadTexts,BioSection,BioList,MyArticle,ArticleHead } from './components/styles';

function App() {

  const aboutData = {
    name:"Fotis Karayannopoulos",
    designation:"SENIOR ASSOCIATE",
    worksAs:"SUPREME COURT LAWYER",
    admittedAt:"Admitted ti Athens Bar in 1992"
  }
  return (
    <div className="App" >
      <Router persondata= {aboutData} />
    </div>
  );
}

export default App;
